Perdana Mentri Malaysia mangrupikeun kapala pamaréntah Malaysia. Perdana Menteri dipilih ku Yang di-Pertuan Agong, Raja Malaysia, ti antara anggota parlemén anu nampi dukungan mayoritas ti parlemén. Biasana pamimpin parpol anu paling kuat di parlemén (Déwan Rahayat) kapilih janten perdana menteri. Ti saprak kamerdékaan dina 1957, sadaya Perdana Menteri asalna ti UMNO (United Malays National Organisation: United Malays National Organisation), partai panggedéna di Barisan Nasional (katelah Parti Perikat dugi ka 1969).
Aya kasalempang yén boh UMNO sareng Partai Islam Malaysia moal ngalarang anu sanés Bumiputera (contona ti etnik Cina) janten Perdana Menteri, tapi pamaréntah sababaraha kali mastikeun masarakat yén konsensus Malaysia henteu meryogikeun Perdana Menteri janten Bumiputera.
Daptar Perdana Mentri Malaysia.
Garis Waktos.
